SUBROUTINE KppDecomp(JVS,IER,LS_NVAR,LS_LU_NONZERO,LS_LU_CROW,LS_LU_DIAG,LS_LU_ICOL)
! ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
!        Sparse LU factorization
! ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

  !USE gckpp_Parameters
  !USE gckpp_JacobianSP
  	  INTEGER,INTENT(IN)::LS_NVAR,LS_LU_NONZERO
	  INTEGER,INTENT(IN)::LS_LU_CROW(LS_NVAR+1),LS_LU_DIAG(LS_NVAR+1)
	  INTEGER,INTENT(IN)::LS_LU_ICOL(LS_LU_NONZERO)
      INTEGER  :: IER
      REAL(kind=dp) :: JVS(LS_LU_NONZERO), W(LS_NVAR), a
      INTEGER  :: k, kk, j, jj

      a = 0. ! mz_rs_20050606
      IER = 0
      DO k=1,LS_NVAR
        ! mz_rs_20050606: don't check if real value == 0
        ! IF ( JVS( LS_LU_DIAG(k) ) .EQ. 0. ) THEN
        IF ( ABS(JVS(LS_LU_DIAG(k))) < TINY(a) ) THEN
            IER = k
            RETURN
        END IF
        DO kk = LS_LU_CROW(k), LS_LU_CROW(k+1)-1
              W( LS_LU_ICOL(kk) ) = JVS(kk)
        END DO
        DO kk = LS_LU_CROW(k), LS_LU_DIAG(k)-1
            j = LS_LU_ICOL(kk)
            a = -W(j) / JVS( LS_LU_DIAG(j) )
            W(j) = -a
            DO jj = LS_LU_DIAG(j)+1, LS_LU_CROW(j+1)-1
               W( LS_LU_ICOL(jj) ) = W( LS_LU_ICOL(jj) ) + a*JVS(jj)
            END DO
         END DO
         DO kk = LS_LU_CROW(k), LS_LU_CROW(k+1)-1
            JVS(kk) = W( LS_LU_ICOL(kk) )
         END DO
      END DO
      
END SUBROUTINE KppDecomp



